import SectionTitle from './sectionTitle.js'
import Listing from './listing.js';
import {Container} from 'react-bootstrap';


function Employment(){
    return (
        <Container>
            <SectionTitle title="Employment"/>
            <Listing title="Professor of Medicine" location="University of the Capitol"
                startYear="1924" endYear="1930"/>
            <Listing title="Head Researcher in Thanatology" location="Thanatica Institue"
                startYear="1930" 
                description="As founder of Thanatica, I, along with the rest of my team of dedicatied
                researchers, have dedicated my life to the pursuit of immortality and humanities conquering over the elements"/>

        </Container>
    );

} export default Employment;
